import React, { Fragment } from "react";
import "./List.css";

function List({ data }) {
  console.log(data);

  if (data.child) {
    return (
      <Fragment>
        <li className="list__item">{data.title}</li>
        <ul className="list__items">
          {data.child.map((d) => (
            <List data={d} />
          ))}
        </ul>
      </Fragment>
    );
  }

  console.log("Hello");
  return (
    <ul className="list__items">
      <li className="list__item">{data.title}</li>
    </ul>
  );
}

export default List;
